import axios from "axios";
import Link from "next/link";

const Search = (props) => {
  const router = useRouter();
  console.log(props.data);
  return (
    <Layout>
      당신이 검색한 키워드는 "{router.query.id}" 입니다.
      <br />
    </Layout>
  );
};
